import './Pool.css';

const Pool = ({ name, ticketPrice, duration }) => {
  return (
    <div className="pool">
      <h2>{name}</h2>
      <p>Ticket Price: {ticketPrice}</p>
      <p>Duration: {duration}</p>
      {/* Add more pool information here */}
    </div>
  );
};

export default Pool;
